INSERT INTO `elements_sites` VALUES (1,1,1,NULL,NULL,NULL,NULL,1,'2024-05-21 13:02:58','2024-05-21 13:02:58','8f706895-caf5-4277-a7f7-7009b7d42a5f'),(2,2,1,'Description Website','description-website','description-website','{\"ef185bbd-e107-4c76-8645-8be21b07d572\": \"<p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\"}',1,'2024-05-21 14:08:45','2024-06-02 10:04:48','d9c31f4f-5c08-47a8-aad6-1b54e4df39f6'),(3,3,1,'Description Website','description-website','description-website',NULL,1,'2024-05-21 14:08:45','2024-05-21 14:08:45','9eca325e-b7d2-45c3-9042-5cdb8f67b36f'),(4,4,1,'Description Website','description-website','description-website',NULL,1,'2024-05-21 14:08:59','2024-05-21 14:08:59','07ffed50-30b0-431d-b5f9-459c287ddad5'),(5,5,1,'Description Website','description-website','description-website',NULL,1,'2024-05-21 14:10:48','2024-05-21 14:10:48','92ccb146-e4cd-4b69-8bce-a5e6bebcaa39'),(7,7,1,'Description Website','description-website','description-website','{\"ef185bbd-e107-4c76-8645-8be21b07d572\": \"Een super leuke, sfeervolle fanfare gelegen in lot met zo een 50 leden\"}',1,'2024-05-21 14:11:11','2024-05-21 14:11:11','7abf378b-f63a-4d17-a1ef-afa86a353453'),(8,8,1,'Description Website','description-website','description-website','{\"ef185bbd-e107-4c76-8645-8be21b07d572\": \"Een super leuke, sfeervolle fanfare gelegen in lot met zo een 50 leden\"}',1,'2024-05-21 14:11:17','2024-05-21 14:11:17','c0a0408a-c228-452f-b585-a65748fba96f'),(9,9,1,'Logo','logo','logo',NULL,1,'2024-05-21 14:13:42','2024-05-21 14:13:42','5ce053dd-4c19-488e-8949-63b6ceb9d9eb'),(10,10,1,'Logo','logo','logo',NULL,1,'2024-05-21 14:13:42','2024-05-21 14:13:42','53633d29-864e-45f3-8795-aa4e07f68b07'),(11,11,1,'Logo fanfare',NULL,NULL,NULL,1,'2024-05-21 14:16:50','2024-05-21 14:16:50','ac6a47bb-9beb-49a1-bee9-e1d9f7aef672'),(13,13,1,'Logo','logo','logo',NULL,1,'2024-05-21 14:18:02','2024-05-21 14:18:02','263169a8-184d-4cde-81b4-5e37d480795b'),(14,14,1,'Evenementen','evenementen','evenementen','{\"71828bfd-3762-4fab-8f2e-01396de7dc26\": \"<h1>Afgelopen</h1><h1>Evenementen</h1>\", \"786f1b02-2a35-471e-8334-7bd7af646d8b\": \"Koop hier je tickets\", \"82e153f5-6437-4e4b-b73b-b5b5206158d1\": \"<p>Zomerconcert met barbecue op het mooie domein van Brouwerij 3 Fonteinen – lambik-O-droom te Lot. Gastoptreden van Concertband Theobaldus uit Groot-Pepingen om 19.15 uur. Aansluitend optreden van KF EMM LOT. Barbecue start om 18 uur. Inschrijven kan via de QR-code of bij de feestbestuurder tot en met woensdag 26 juni 2024.</p>\", \"e0e8195c-4525-4b10-b897-3fd048c2ff72\": \"<h1>Volgend</h1><h1>Evenement</h1>\"}',1,'2024-05-21 14:21:33','2024-06-01 09:06:22','7fba4760-ded5-4d34-9af4-541c03619ad2'),(15,15,1,'Evenementen','evenementen','evenementen',NULL,1,'2024-05-21 14:21:59','2024-05-21 14:21:59','185d29cc-bc98-4cd2-9fb6-e5cb7d20ebd9'),(16,16,1,'Orkest','orkest','orkest','{\"72ea5a90-88a5-4883-9290-cf75d48492bc\": \"<h3>Dirigent</h3><h2>Mike Similon</h2><p>Mike Similon is een jonge dirigent, afkomstig uit Lembeek. Mike is saxofonist en is gepassioneerd door de muziek. In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\", \"bba7b262-cbfc-43cc-9579-7c1e334599d1\": \"<p>Onze jeugdopleiding bestaat uit 2 delen: de individuele lessen op vrijdag in de jeugdlokalen in de Kloosterstraat en een maandelijks samenspel op zondagvoormiddag in GBS Blokbos. De jeugdlessen staan onder leiding van Kenza De Nolf (saxofoons) en Zenn Brichau (koper en slagwerk). Het samenspel wordt geleid door een dirigent of door de eigen muzikanten.</p><p>Elk jaar organiseren we een paasstage. Deze staat open voor alle jongeren van 8 tot 18 jaar met en zonder muzikale ervaring. Vriendschap en sfeer zijn zeer belangrijk bij de jeugd. Daarom organiseren we regelmatig een uitstap, een leuke activiteit,...</p>\"}',1,'2024-05-21 14:22:01','2024-06-06 17:03:01','a6cfbf64-1cfc-4cd5-946f-7d8be3ba7212'),(17,17,1,'Orkest','orkest','orkest',NULL,1,'2024-05-21 14:22:11','2024-05-21 14:22:11','225fc8e8-8963-4690-b766-4434ff4f6d4f'),(18,18,1,'Galerij','galerij','galerij',NULL,1,'2024-05-21 14:22:17','2024-05-21 18:05:53','f0793e11-cf33-4c8e-84d1-a51c937367d5'),(19,19,1,'Galerij','galerij','galerij',NULL,1,'2024-05-21 14:22:23','2024-05-21 14:22:23','501e4f82-928f-49c9-bf1e-376ce8b0ad76'),(20,20,1,'Geschiedenis','geschiedenis','geschiedenis','{\"90b1aed9-67d9-4d83-baf3-2b78b929ee89\": \"<p>De geschiedenis van onze fanfare gaat ver terug, want ze is ouder dan onze gemeente Lot zelf. Als we grasduinen in de geschiedenis van Lot, de fabriek, het kanaal, de spoorweg, stuit men dan ook telkens weer op de Lotse fanfare. Zo uitgebreid gaan we het hier niet hebben over onze geschiedenis en deze van Lot. Hiervoor verwijzen we graag naar het tijdschrift van het heemkundig genootschap ‘Van Witthem’ uit Beersel, die in het jaar 2000 een editie besteedden aan de fanfare van Lot. Graag geven we hier wel een beknopt overzicht met enkele leuke en belangrijke feiten…</p>\"}',1,'2024-05-21 14:22:26','2024-06-08 12:08:42','7938f945-84ea-470c-ba4b-9509526d523c'),(21,21,1,'Geschiedenis','geschiedenis','geschiedenis',NULL,1,'2024-05-21 14:22:31','2024-05-21 14:22:31','dcded773-272e-4050-bb31-bce3e7a90037'),(22,22,1,'Contact','contact','contact','{\"9565be4d-6351-4f25-acc5-7a31a8c7725f\": \"<p>&lt;iframe width=\\\"100%\\\" height=\\\"600\\\" frameborder=\\\"0\\\" scrolling=\\\"no\\\" marginheight=\\\"0\\\" marginwidth=\\\"0\\\" src=\\\"https://maps.google.com/maps?width=100%25&amp;amp;height=600&amp;amp;hl=en&amp;amp;q=Beerselsestraat%202,%201651%20Lot+(My%20Business%20Name)&amp;amp;t=&amp;amp;z=15&amp;amp;ie=UTF8&amp;amp;iwloc=B&amp;amp;output=embed\\\"&gt;&lt;a href=\\\"https://www.gps.ie/\\\"&gt;gps systems&lt;/a&gt;&lt;/iframe&gt;</p>\", \"d5ad07e4-3e8f-4617-a945-0f9d07916d7f\": \"Stuur ons een berichtje\"}',1,'2024-05-21 14:22:34','2024-05-29 19:40:13','556b7bef-e463-4b93-a3d9-446a3be5d510'),(23,23,1,'Contact','contact','contact',NULL,1,'2024-05-21 14:22:38','2024-05-21 14:22:38','b584f49e-71dd-47e3-a7bd-91b016dc580f'),(24,24,1,'Tickets','tickets','tickets',NULL,1,'2024-05-21 14:22:42','2024-05-21 18:06:14','6c3afbb5-f428-4918-9f4d-ed20e463bfd3'),(25,25,1,'Tickets','tickets','tickets',NULL,1,'2024-05-21 14:22:46','2024-05-21 14:22:46','e502bc75-87ef-4f66-bf59-3987f49178b5'),(26,26,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"<h2>\\\"Waar woorden tekort schieten, spreekt de muziek.\\\" </h2><p>― Hans Christian Andersen ―</p>\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>KONINKLIJKE FANFARE EMM LOT</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;</a></h6>\"}',1,'2024-05-21 14:26:55','2024-06-03 11:37:31','31ee68e4-bcfc-4bcd-a128-6ed380a13816'),(27,27,1,'Home pagina','home-pagina','__home__',NULL,1,'2024-05-21 14:26:55','2024-05-21 14:26:55','c9689e72-059f-479b-8ee5-40bd0d655be3'),(28,28,1,'Facebook 1692363676853 7098287739281512736',NULL,NULL,NULL,1,'2024-05-21 14:32:14','2024-05-21 14:32:14','2c6ccb32-44f8-49ef-8318-14e0921453a9'),(29,29,1,'Foto1',NULL,NULL,NULL,1,'2024-05-21 14:32:15','2024-05-21 14:32:15','4efffd81-9181-4185-8163-072aeba30c75'),(31,31,1,'Jeugd',NULL,NULL,NULL,1,'2024-05-21 14:32:15','2024-05-21 14:32:15','609b4c8d-50c6-4988-ae06-284ef55f9c6c'),(32,32,1,'387743023 640732034763703 3885172412596527105 n',NULL,NULL,NULL,1,'2024-05-21 14:32:16','2024-05-21 14:32:16','1c41974e-c702-44b6-901c-8052266ad979'),(33,33,1,'Home pagina','home-pagina','__home__',NULL,1,'2024-05-21 14:32:18','2024-05-21 14:32:18','a068fdb9-13a7-47fb-8891-2280af0c2d3e'),(35,35,1,'GeschiedenisPicture',NULL,NULL,NULL,1,'2024-05-21 14:46:23','2024-05-21 14:46:50','6888f0b9-f705-4b73-bcd5-486259e02935'),(36,36,1,'Background',NULL,NULL,NULL,1,'2024-05-21 14:47:43','2024-05-21 14:47:43','0c097bfa-5daa-49ee-89eb-e9597a34e8ec'),(37,37,1,'Recent',NULL,NULL,NULL,1,'2024-05-21 14:47:47','2024-05-21 14:47:47','9b8c8636-3e43-4eda-b4d3-29727a92b16b'),(39,39,1,'Foto1',NULL,NULL,NULL,1,'2024-05-21 14:49:09','2024-05-21 14:49:09','9db008fe-8dd5-400e-a983-340147e80bf3'),(41,41,1,'Jeugd',NULL,NULL,NULL,1,'2024-05-21 14:49:29','2024-05-21 14:49:29','96fd37a6-c312-4052-9977-f1b78a9c537f'),(43,43,1,'Facebook 1692363676853 7098287739281512736',NULL,NULL,NULL,1,'2024-05-21 14:49:44','2024-05-21 14:49:44','33563e14-9c65-4e3b-aed0-e11dddf88484'),(45,45,1,'TDW1658',NULL,NULL,NULL,1,'2024-05-21 14:50:27','2024-05-21 14:50:27','3f722129-ee23-4e7e-8393-475873b1cf34'),(46,46,1,'Bezetting','bezetting',NULL,'{\"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bezetting\"}',1,'2024-05-21 14:50:34','2024-06-02 09:39:56','1f3862f7-dda3-4b49-ac15-27fc0dfe6227'),(47,47,1,'Jeugdopleiding','jeugdopleiding',NULL,'{\"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#jeugd\"}',1,'2024-05-21 14:50:34','2024-06-09 09:14:29','0480cae8-7084-4290-9501-5113d8cf0754'),(48,48,1,'Dirigent','dirigent',NULL,'{\"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#dirigent\"}',1,'2024-05-21 14:50:34','2024-06-06 13:35:55','e0ca897c-5663-4207-9060-85d30222690a'),(49,49,1,'Bestuur','bestuur',NULL,'{\"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bestuur\"}',1,'2024-05-21 14:50:34','2024-06-09 08:27:22','8a06f91b-3957-4cda-b14b-edabfcd2b4a3'),(50,50,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"Music expresses that which cannot be said and on which it is impossible to be silent.\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>WIE ZIJN WE EN WAT DOEN WE</h1><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetitie