 gemeente Sint-Pieters-Leeuw. De muziekale jaargang begint den 1sten juni… Hare voortduring is onbepaald.” En ondertussen kon de fanfare in het jaar 2000 haar 125 jaar al vieren!</p>\", \"e0e8195c-4525-4b10-b897-3fd048c2ff72\": \"<h1>Volgend</h1><h1>Evenement</h1>\"}',1,'2024-05-21 18:23:26','2024-05-21 18:23:26','17d5c96b-edb9-4d85-8531-b7a611b6433e'),(85,85,1,'Affiche zomerconcert',NULL,NULL,NULL,1,'2024-05-22 12:23:35','2024-05-22 12:23:35','c421d74d-4acb-41ea-9d80-1e1b11caa160'),(86,86,1,'Evenementen','evenementen','evenementen','{\"786f1b02-2a35-471e-8334-7bd7af646d8b\": \"Koop hier je tickets\", \"82e153f5-6437-4e4b-b73b-b5b5206158d1\": \"<p>Onze fanfare werd opgericht op 1 juli 1875. In het kapittel van één van de statuten lezen we: “Artikel I – De maatschappij, gesticht buiten alle partijgeest, onden den naam van: Fanfaren van Loth met de leus Eendracht Maakt Macht, heeft voor doel het onderricht, het oefenen en de verbetering van de muziekkunst. De zetel der maatschappij is gevestigd te Loth, gemeente Sint-Pieters-Leeuw. De muziekale jaargang begint den 1sten juni… Hare voortduring is onbepaald.” En ondertussen kon de fanfare in het jaar 2000 haar 125 jaar al vieren!</p>\", \"e0e8195c-4525-4b10-b897-3fd048c2ff72\": \"<h1>Volgend</h1><h1>Evenement</h1>\"}',1,'2024-05-22 12:23:40','2024-05-22 12:23:40','f588bf05-a42f-4ac0-9bca-e0ed8d4e2f34'),(88,88,1,'Affiche zomerconcert',NULL,NULL,NULL,1,'2024-05-22 12:24:13','2024-05-22 12:24:13','a669b119-5fa8-4b3e-b358-149b1415b071'),(89,89,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"Music expresses that which cannot be said and on which it is impossible to be silent.\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>WIE ZIJN WE EN WAT DOEN WE</h1><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><p><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></p>\"}',1,'2024-05-22 12:24:17','2024-05-22 12:24:17','1a97a3fb-7a10-4ee5-a632-cded8e4de774'),(90,90,1,'Bezetting','bezetting',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna</p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bezetting\"}',1,'2024-05-22 12:24:17','2024-05-22 12:24:17','e8c77df6-ca95-4202-9ae5-aabe7e57b3cd'),(91,91,1,'Jeugdopleiding','jeugdopleiding',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna</p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#jeugd\"}',1,'2024-05-22 12:24:17','2024-05-22 12:24:17','416ef74f-7b10-455e-a2d1-70b21f3bf9c2'),(92,92,1,'Dirigent','dirigent',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna</p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#dirigent\"}',1,'2024-05-22 12:24:17','2024-05-22 12:24:17','e2e40abc-0316-4910-af94-3d258c62eaa5'),(93,93,1,'Bestuur','bestuur',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna</p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bestuur\"}',1,'2024-05-22 12:24:17','2024-05-22 12:24:17','846f8c24-c262-4268-bb2e-5d860b40ac1b'),(95,95,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"Waar woorden tekort schieten spreekt de muziek.  ― Hans Christian Andersen Deens dichter en sprookjesschrijver (1805 - 1875)\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>WIE ZIJN WE EN WAT DOEN WE</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><p><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></p>\"}',1,'2024-05-22 12:30:53','2024-05-22 12:30:53','b032a60c-ee87-4d42-b0d3-15124edf1d2e'),(97,97,1,'Evenementen','evenementen','evenementen','{\"786f1b02-2a35-471e-8334-7bd7af646d8b\": \"Koop hier je tickets\", \"82e153f5-6437-4e4b-b73b-b5b5206158d1\": \"<p>Zomerconcert met barbecue op het mooie domein van Brouwerij 3 Fonteinen – lambik-O-droom te Lot. Gastoptreden van Concertband Theobaldus uit Groot-Pepingen om 19.15 uur. Aansluitend optreden van KF EMM LOT. Barbecue start om 18 uur. Inschrijven kan via de QR-code of bij de feestbestuurder tot en met woensdag 26 juni 2024.</p>\", \"e0e8195c-4525-4b10-b897-3fd048c2ff72\": \"<h1>Volgend</h1><h1>Evenement</h1>\"}',1,'2024-05-22 12:32:13','2024-05-22 12:32:13','98b1b6a7-bf16-4b03-896f-42abfb2fe355'),(100,100,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"Waar woorden tekort schieten spreekt de muziek.  ― Hans Christian Andersen Deens dichter en sprookjesschrijver (1805 - 1875)\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>WIE ZIJN WE EN WAT DOEN WE</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><p><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></p>\"}',1,'2024-05-22 12:46:05','2024-05-22 12:46:05','8fcd4f23-e27f-49dc-ab51-b56c0a5f9f11'),(101,101,1,'Jeugdopleiding','jeugdopleiding',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Onze jeugdopleiding bestaat uit 2 delen: de individuele lessen op vrijdag in de jeugdlokalen in de Kloosterstraat en een maandelijks samenspel op zondagvoormiddag in GBS Blokbos. </p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#jeugd\"}',1,'2024-05-22 12:46:05','2024-05-22 12:46:05','187ef23a-8423-4a91-b3c6-220e92b054fa'),(102,102,1,'Dirigent','dirigent