akt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><p><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></p>\"}',1,'2024-05-23 12:52:33','2024-05-23 12:52:33','61ea192b-9c5e-481f-aec9-40d342270f81'),(138,138,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"Waar woorden tekort schieten spreekt de muziek.  ― Hans Christian Andersen Deens dichter en sprookjesschrijver (1805 - 1875)\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>WIE ZIJN WE EN WAT DOEN WE</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><p><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></p>\"}',1,'2024-05-23 16:31:22','2024-05-23 16:31:22','23fe8028-61b8-49a9-9b7b-f0678823f24e'),(140,140,1,'Manu Coone',NULL,NULL,NULL,1,'2024-05-24 09:35:55','2024-05-24 09:35:55','1d3eefd7-89c7-4b51-b095-09fb705e3324'),(141,141,1,'Marianne Carpentier',NUL