 In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','de02151c-e564-4d0c-b341-8df1e9f71d79'),(209,209,1,'Hervé Dumoulin','hervé-dumoulin',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Voorzitter - bugel\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','6eecdf08-d16b-49f2-a3c4-a2c97dee069f'),(210,210,1,'Manu Coone','manu-coone',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Secretaris en ondervoorzitter - saxofoon\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','1b890ed0-f3d3-4cc7-ab3c-ed1f7e40e3e2'),(211,211,1,'Marianne Carpentier','marianne-carpentier',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Penningsmeester\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','848c825e-90e3-4a22-9b3e-47ffc4dec8ae'),(212,212,1,'Hendrik Vekeman','hendrik-vekeman',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"feestbestuurder - saxofoon\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','5a815db7-ce4b-43e3-8b9d-87dabc5741e0'),(213,213,1,'Stanislas Despiegelaere','stanislas-despiegelaere',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Bestuurslid - slagwerk\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','d96068f6-0e0e-4bc5-88f4-d7677b8581d9'),(214,214,1,'Rudy Van Roy','rudy-van-roy',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Bestuurslid\"}',1,'2024-05-29 10:47:36','2024-05-29 10:47:36','ef1a91c1-59c4-48