en leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></h6>\"}',1,'2024-05-29 18:52:48','2024-05-29 18:52:48','14436bce-e078-4bf6-b0e8-224ee852b71e'),(236,236,1,'Contact','contact','contact','{\"9565be4d-6351-4f25-acc5-7a31a8c7725f\": \"<iframe width=\\\"100%\\\" height=\\\"600\\\" frameborder=\\\"0\\\" scrolling=\\\"no\\\" marginheight=\\\"0\\\" marginwidth=\\\"0\\\" src=\\\"https://maps.google.com/maps?width=100%25&amp;height=600&amp;hl=en&amp;q=Beerselsestraat%202,%201651%20Lot+(My%20Business%20Name)&amp;t=&amp;z=15&amp;ie=UTF8&amp;iwloc=B&amp;output=embed\\\"><a href=\\\"https://www.gps.ie/\\\">gps systems</a></iframe>\", \"d5ad07e4-3e8f-4617-a945-0f9d07916d7f\": \"Stuur ons een berichtje\"}',1,'2024-05-29 19:35:54','2024-05-29 19:35:54','670ca32a-6035-4ac0-90a0-2f5a4fe9a3ca'),(238,238,1,'Contact','contact','contact','{\"9565be4d-6351-4f25-acc5-7a31a8c7725f\": \"<p>&lt;iframe width=\\\"100%\\\" height=\\\"600\\\" frameborder=\\\"0\\\" scrolling=\\\"no\\\" marginheight=\\\"0\\\" marginwidth=\\\"0\\\" src=\\\"https://maps.google.com/maps?width=100%25&amp;amp;height=600&amp;amp;hl=en&amp;amp;q=Beerselsestraat%202,%201651%20Lot