staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></h6>\"}',1,'2024-06-01 08:30:02','2024-06-01 08:30:02','28680dba-9844-4ea5-8af7-8f8b43dcecc3'),(268,268,1,'Bezetting','bezetting',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>In ons orkest zijn alle fanfare-instrumenten welkom. De muzikanten variëren van 8 tot 80 jaar. Wij zijn een leuke, gemotiveerde groep die graag diverse muziekstijlen spelen.</p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bezetting\"}',1,'2024-06-01 08:30:02','2024-06-01 08:30:02','3743cb67-32a7-49ea-bd12-6670a294179f'),(269,269,1,'Bestuur','bestuur',NULL,'{\"996ef0a6-1479-4659-b813-24af79b3181f\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. </p>\", \"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bestuur\"}',1,'2024-06-01 08:30:02','2024-06-01 08:30:02','ea6323cc-ac92-42a3-af4b-39edd25ab3fc'),(272,272,1,'Recent',NULL,NULL,NULL,1,'2024-06-01 08:46:49','2024-06-01 08:46:49','55fbe1d0-608a-4440-a2b1-d6aeece7110a'),(274,274,1,'Pensenkermis',NULL,NULL,NULL,1,'2024-06-01 08:50:18','2024-06-01 08:50:18','7bc84cea-ee15-4e02-a76a-5665b29604dd'),(276,276,1,'Winterconcert',NULL,NULL,NULL,1,'2024-06-01 08:50:54','2024-06-01 08:50:54','79f55bd1-1141-4e7b-9de2-032375b29e1e'),(279,279,1,'USA Today \'24','usa-today',NULL,'{\"898577fb-a3f9-4df7-9922-724d07ec49a0\": \"<p>Na ons succesvol \\\"High-tea\\\" concert in 2023, staken we dit jaar de grote plas over richting USA. De hele avond lang loodsten de presentator, dirigent en het orkest de gasten doorheen de Amerikaanse (muziek)geschiedenis. Pop, rock &amp; roll, musical, jazz, rock,... Verschillende muziekstijlen kwamen aan bod. De inkleding was top: vlaggen, filmposters, kranten, donuts,... De bezoekers kregen een USA-krant met allerlei info over diverse muzikale jaren.</p>\"}',1,'2024-06-01 09:06:22','2024-06-04 10:18:12','5e2ff29b-909a-44f9-84d2-c2d7e95d6ec7'),(280,280,1,'Pensenkermis \'24','pensenkermis',NULL,'{\"898577fb-a3f9-4df7-9922-724d07ec49a0\": \"<p>Jaarlijks ontvangen we onze gasten in Zaal Onze Kring/Buurthuis Babbellot voor onze 2-daagse eetkermis: pensen, steak, braadworst, speciale schotel, artisanale kaaskroketten, verse soep enz... We werken zoveel mogelijk met lokale handelaars. Democratische prijzen, verzorgde bediening, aangenaam kader.</p>\"}',1,'2024-06-01 09:06:22','2024-06-04 10:18:25','78b74a1b-e3a7-402a-8633-ed1be65f1ef3'),(281,281,1,'Winterconcert \'23','winterconcert-23',NULL,'{\"898577fb-a3f9-4df7-9922-724d07ec49a0\": \"<p>In december 2023 stond de alt sax in de kijker tijdens het winterconcert. De soliste, Rita Vandermeirsch, was jarenlang actief muzikant in onze fanfare en stond in voor de jeugdopleiding. Hoog tijd dat ze, kort voor haar pensioen als lesgeefster in verschillende academies, nog eens haar kunsten kon tonen op ons podium. Een schot in de roos!</p>\"}',1,'2024-06-01 09:06:22','2024-06-04 10:18:37','08a1f173-d0cc-4c39-85bb-8d754ee0c972'),(282,282,1,'Evenementen','evenementen','evenementen','{\"71828bfd-3762-4fab-8f2e-01396de7dc26\": \"<h1>Afgelopen</h1><h1>Evenementen</h1>\", \"786f1b02-2a35-471e-8334-7bd7af646d8b\": \"Koop hier je tickets\", \"82e153f5-6437-4e4b-b73b-b5b5206158d1\": \"<p>Zomerconcert met barbecue op het mooie domein van Brouwerij 3 Fonteinen – lambik-O-droom te Lot. Gastoptreden van Concertband Theobaldus uit Groot-Pepingen om 19.15 uur. Aansluiten