','hendrik-vekeman',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Hendrik Vekeman\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','46ed185a-5201-44e1-b619-67d74c53643d'),(318,318,1,'Séverine Filhaster','séverine-filhaster',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Séverine Filhaster\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','ae894918-387f-41d1-8731-cea4e73830a2'),(319,319,1,'Danny Van Gyseghem','danny-van-gyseghem',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Danny Van Gyseghem\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','4037a6c7-093b-41f6-aba9-fad75f1c0031'),(320,320,1,'Wim Ghysels','wim-ghysels',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Wim Ghysels\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','7c552b59-ecc9-4740-87bd-8a030c2774f7'),(321,321,1,'Hervé Dumoulin','hervé-dumoulin',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Hervé Dumoulin\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','6f629802-6645-4c1a-bd0a-f94932c37c56'),(322,322,1,'Yannick Devos','yannick-devos',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Yannick Devos\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','d49b1f18-4148-4db0-b9c9-025570bb5f16'),(323,323,1,'Mike Similon','mike-similon',NULL,'{\"7ae26941-e208-4cb8-ac03-97c675168221\": \"Mike Similon\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','bc78107a-853a-4800-90f3-d739d7b724a6'),(324,324,1,'Hervé Dumoulin','hervé-dumoulin',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"Voorzitter - bugel\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','cbb3f515-8829-483a-8d10-354ee70e1cf0'),(325,325,1,'Hendrik Vekeman','hendrik-vekeman',NULL,'{\"678ccb12-ce36-45ae-92e6-a7f2f7b74097\": \"feestbestuurder - saxofoon\"}',1,'2024-06-01 15:08:25','2024-06-01 15:08:25','1dd9a519-f20f-461c-ad03-037934ec1a51'),(326,326,1,'Tickets link','tickets-link','tickets-link','{\"2906f39c-8e17-416b-8863-2e4e4425c61f\": \"https://be.ticketgang.eu/orgFrameSaleNew.php?org=520041&event=147393#\"}',1,'2024-06-02 09:36:58','2024-06-02 09:36:58','62ce1233-de52-434a-8557-531680fe803e'),(328,328,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"<h2>\\\"Waar woorden tekort schieten spreekt de muziek.\\\" </h2><p><a href=\\\"https://citaten.net/quotes/van-hans_christian_andersen.html\\\">― Hans Christian Andersen ―</a></p>\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>KONINKLIJKE FANFARE EMM LOT</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></h6>\"}',1,'2024-06-02 09:37:56','2024-06-02 09:37:56','a866b092-de99-4ddc-89cb-ada98621bde6'),(330,330,1,'Home pagina','home-pagina','__home__','{\"601065a8-2e4c-4f2f-99c5-093684b79bb5\": \"<h2>\\\"Waar woorden tekort schieten, spreekt de muziek.\\\" </h2><p>― Hans Christian Andersen ―</p>\", \"a481ead1-3d4b-4a43-8249-9dbc1c36f142\": \"<h1>KONINKLIJKE FANFARE EMM LOT</h1><p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\", \"a91090bb-55e3-4d92-a49d-66bdb537c3d6\": \"<h2>Onze geschiedenis</h2><p>Het ontstaan van de fanfare “Eendracht Maakt Macht” is nauw verbonden met de geschiedenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;&gt;&gt;</a></h6>\"}',1,'2024-06-02 09:38:39','2024-06-02 09:38:39','94696dd2-3e3c-4b66-8e3c-b1d7f7a6fa64'),(333,333,1,'Footer','footer',NULL,'{\"27aa1d47-b334-4d39-b6cd-ba3e292eb470\": \"<h3>Lokaal:</h3><p>GBS Blokbos</p><p>BEERSELSESTRAAT 2</p><p>1651 LOT</p>\", \"7dbeca9a-db31-4e0d-b3cc-08bd6cde2f42\": \"<h3>Secretariaat:</h3><p>BEERSELSESTRAAT 16 <br />1651 LOT<br />info@emmlot.be</p>\"}',1,'2024-06-02 09:41:36','2024-06-02 09:41:36','34a22609-61f4-408b-bbf0-527c774f17db'),(335,335,1,'2024-06-02 03:00:47',NULL,NULL,NULL,1,'2024-06-02 10:00:48','2024-06-02 10:00:48','f73a853e-ebb6-4851-b8e5-6ef5f88cd2c9'),(337,337,1,'Description Website','description-website','description-website','{\"ef185bbd-e107-4c76-8645-8be21b07d572\": \"<p>Onze fanfare werd gesticht in 1875. Wij zijn een leuke, dynamische muziekgroep waar alle fanfare-instrumenten welkom zijn. Elke vrijdag repeteren we in GBS Blokbos van 20 uur tot 22 uur. Het orkest staat sinds 2022 onder leiding van Mike Similon. Daarnaast hebben we een eigen jeugdwerking met individuele lessen en samenspel. De lessen gaan door in de jeugdlokalen in de Kloosterstraat en staan onder leiding van Zenn Brichau en Kenza De Nolf</p>\"}',1,'2024-06-02 10:04:48','2024-06-02 10:04:48','0f7b98b2-cd30-4453-bb5d-459f17ecbae9'),(339,339,1