edenis van de textielfabriek Scheppers. Joseph Huysmans, die de leiding had van de fabriek, zetelde in het bestuur en het beschermcomité van de fanfare. Repetities en uitvoeringen vonden ook regelmatig plaats in de fabrieksgebouwen.</p><h6><a href=\\\"{entry:20@1:url||https://emm-fanfare.ddev.site/geschiedenis}\\\">Lees hier meer &gt;</a></h6>\"}',1,'2024-06-03 11:37:31','2024-06-03 11:37:31','e11c954b-166a-4572-bf47-124fb0a669c3'),(416,416,1,'Bezetting','bezetting',NULL,'{\"b2204521-4e05-4e08-ab29-5e59f6c8da4b\": \"/orkest#bezetting\"}',1,'2024-06-03 11:37:31','2024-06-03 11:37:31','0ff628dc-3144-403a-b22f-efe0dfaea18f'),(418,418,1,'Stanislas',NULL,NULL,NULL,1,'2024-06-04 07:45:42','2024-06-04 07:45:42','c18a22e8-b47a-48d3-802c-78108de9c8fa'),(420,420,1,'Hv',NULL,NULL,NULL,1,'2024-06-04 07:49:12','2024-06-04 07:49:12','0ac56ef9-9f9f-4ff8-b304-5444b1be27f7'),(422,422,1,'Orkest','orkest','orkest','{\"72ea5a90-88a5-4883-9290-cf75d48492bc\": \"<h3>Mike Similon</h3><h2>Dirigent</h2><p>Mike Similon is een jonge dirigent, afkomstig uit Lembeek. Mike is saxofonist en is gepassioneerd door de muziek. In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\"}',1,'2024-06-04 07:52:56','2024-06-04 07:52:56','4518285d-dbf6-467a-94f4-f814e1b3e163'),(423,423,1,'sopraan sax','sopraan-sax',NULL,'{\"af1ebc6a-2469-45ab-b913-198a84c4d328\": \"<p>Marijke Elsoucht</p><p>Sandra Degroote</p><p>St