n samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\"}',1,'2024-06-04 07:54:25','2024-06-04 07:54:25','818970fe-06ec-4189-908f-d0d6052bf9ae'),(439,439,1,'Orkest','orkest','orkest','{\"72ea5a90-88a5-4883-9290-cf75d48492bc\": \"<h3>Dirigent</h3><h2>Mike Similon</h2><p>Mike Similon is een jonge dirigent, afkomstig uit Lembeek. Mike is saxofonist en is gepassioneerd door de muziek. In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\"}',1,'2024-06-04 07:54:37','2024-06-04 07:54:37','829bc39a-7a6f-456d-b4a0-c34f99f45228'),(443,443,1,'Dirigent',NULL,NULL,NULL,1,'2024-06-06 13:00:07','2024-06-06 13:00:07','eb145ab7-3356-48f1-bf39-facd4ea7ec3e'),(444,444,1,'Orkest','orkest','orkest','{\"72ea5a90-88a5-4883-9290-cf75d48492bc\": \"<h3>Dirigent</h3><h2>Mike Similon</h2><p>Mike Similon is een jonge dirigent, afkomstig uit Lembeek. Mike is saxofonist en is gepassioneerd door de muziek. In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\"}',1,'2024-06-06 13:00:10','2024-06-06 13:00:10','c4c39894-8dc4-47e2-b7d1-9352486e7157'),(446,446,1,'438118945 745838050919767 8259809860280699144 n',NULL,NULL,NULL,1,'2024-06-06 13:35:54','2024-06-06 13:35:54','036d687c-ab1d-40ce-9301-04566fdc8ba7'),(448,448,1,'Dirigent',NULL,NULL,NULL,1,'2024-06-06 13:37:43','2024-06-06 13:37:43','9a5d70ef-4c10-44a8-94d3-e02db114c410'),(450,450,1,'Kenza',NULL,NULL,NULL,1,'2024-06-06 17:02:56','2024-06-06 17:02:56','98aa92d2-fd5a-4b54-a105-423a41233a43'),(451,451,1,'Zenn',NULL,NULL,NULL,1,'2024-06-06 17:02:57','2024-06-06 17:02:57','10e95231-796f-46ad-85d2-ce907b5a7888'),(452,452,1,'Orkest','orkest','orkest','{\"72ea5a90-88a5-4883-9290-cf75d48492bc\": \"<h3>Dirigent</h3><h2>Mike Similon</h2><p>Mike Similon is een jonge dirigent, afkomstig uit Lembeek. Mike is saxofonist en is gepassioneerd door de muziek. In 2021 behaalde hij zijn beroepskwalificatie amateur dirigent instrumentale muziek. Daarnaast leidt hij ook de Jonge Ware Broeders uit Herfelingen, een jeugdorkest van ongeveer 40 muzikanten, is hij lid van het dweilorkest “DeciBells” uit Lembeek, bestuurslid van de koepel Sint-Veroonmars en van de Koninklijke Soldatenclub Congo Lembeek.</p>\", \"b7149097-3b49-4ddd-a788-6f9d1d81a8cd\": \"<p>Het bestuur bestaat uit muzikanten en niet-muzikanten. Wij zetten samen ons beste beentje voor om het drukke programma optimaal voor te bereiden en in goede banen te leiden. Hiervoor kunnen we rekenen op de steun van muzikanten, familieleden en sympathisanten.</p>\", \"bba7b262-cbfc-43cc-9579-7c1e334599d1\": \"<p>Onze jeugdopleiding bestaat uit 2 delen: de individuele lessen op vrijdag in de jeugdlokalen in de Kloosterstraat en een maandelijks samenspel op zondagvoormiddag in GBS Blokbos. De jeugdlessen staan onder leiding van Kenza De Nolf (saxofoons) en Zenn Brichau (koper en slagwerk). Het samenspel wordt geleid door een dirigent of door de eigen muzikanten.</p><p>Elk jaar organiseren we een paasstage. Deze staat open voor alle jongeren van 8 tot 18 jaar met en zonder muzikale ervaring. Vriendschap en sfeer zijn zeer belangrijk bij de jeugd. Daarom organiseren we regelmatig een uitstap, een leuke activiteit,...</p>\"}',1,'2024-06-06 17:03:01','2024-06-06 17:03:01','3b6802f9-06c9-4b08-9ebe-0f59d2410eb1'),(456,456,1,'2024-06-08 01:13:12',NULL,NULL,NULL,1,'2024-06-08 08:13:13','2024-06-08 08:13:13','f85fe3f8-9fe6-4a48-ba90-18037a41950b'),(458,458,1,'Galerij','galerij','galerij',NULL,1,'2024-06-08 11:27:29','2024-06-08 11:27:29','d43f50e0-e343-482b-a98c-c877f02f9dff'),(460,460,1,'Geschiedenis','geschiedenis','geschiedenis','{\"90b1aed9-67d9-4d83-baf3-2b78b929ee89\": \"<p>De geschiedenis van onze fanfare gaat ver terug, want ze is ouder dan onze gemeente Lot zelf. Als we grasduinen in de geschiedenis van Lot, de fabriek, het kanaal, de spoorweg, stuit men dan ook telkens weer op de Lotse fanfare. Zo uitgebreid gaan we het hier niet hebben over onze geschiedenis en deze van Lot. Hiervoor verwijzen we graag naar het tijdschrift van het heemkundig genootschap ‘Van Witthem’ uit Beersel, die in het jaar 2000 een editie besteedden aan de fanfare van Lot. Graag geven we hier wel een beknopt overzicht met enkele leuke en belangrijke feiten…</p>\"}',1,'2024-06-08 12:08:42','2024-06-08 12:08:42','b058ed54-0ab9-4cbf-a927-70a4d52e7f44'),(463,463,1,'Facebook 1692363766561 7098288115545636057',NULL,NULL,NULL,1,'2024-06-08 12:15:50','2024-06-08 12:15:50','61763d2f-e5a5-480f-b373-4763cb5bb437'),(465,465,1,'438127964 745837830919789 2725447578085127004 n',NULL,NULL,NULL,1,'2024-06-08 12:16:48','2024-06-08 12:16:48','e1e8261a-1e31-4c39-8170-aabde2db30a0'),(467,467,1,'Geschiedenis BANNER',NULL,NULL,NULL,1,'2024-06-08 12:17:42','2024-06-08 12:17:42','6159f091-f844-4a93-94ac-942de64cf460'),(469,469,1,'342191003 192174040341725 9008818654842014245 n',NULL,NULL,NULL,1,'2024-06-08 12:20:01','2024-06-08 12:20:01','09c52cc4-1324-49d7-9e9b-fb8ee2eeef52'),(471,471,1,'342990857 805003033822172 6234632658791902382 n',NULL,NULL,NULL,1,'2024-06-08 12:20:46','2024-06-08 12:20:46','374525b0-a52e-4964-a2cf-4072242ca302'),(472,472,1,NULL,'__temp_chzufwgtazgsrcgczzytnztqfihztxhyephe',NULL,NULL,1,'2024-06-08 12:20:55','2024-06-08 12:20:55','6cb3edec-3704-4284-9bf5-ac6b1bf90b6f'),(473,473,1,'Het ontstaan in 1875','het-ontstaan-in-1875',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>De meeste fanfares en harmonieën ontstonden in de periode 1875-1914, want een dorp zonder muziekvereniging kon in die tijde niet meer. Zo ontstonden de Koninklijke Fanfare “Sint Lambertus” van Beersel en de Koninklijke Fanfare “<strong>Eendracht Maakt Macht</strong>” van Lot in <strong>1875</strong>, “De Onbemiddelden” uit Wauweringen in 1876, “De Eendracht” van Dworp in 1877, de Koninklijke Fanfare “De Vrijheidsvrienden” van Huizingen in 1875 en “Sint-Jozef” uit Kesterbeek tenslotte in 1899. In deze periode is er in Huizingen ook de fanfare “Sint-Leonardus”. Het kan zijn dat er over de fanfare van Dworp wel een misverstand bestaat.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','3351b2c7-19d4-4c52-b857-4d711761b64b'),(474,474,1,'Fanfaren van Loth','fanfaren-van-loth',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Onze fanfare werd opgericht op 1 juli 1875. In het kapittel van één van de statuten lezen we: <i>“Artikel I – De maatschappij, gesticht buiten alle partijgeest, onden den naam van: Fanfaren van Loth met de leus Eendracht Maakt Macht, heeft voor doel het onderricht, het oefenen en de verbetering van de muziekkunst. De zetel der maatschappij is gevestigd te Loth, gemeente Sint-Pieters-Leeuw. De muziekale jaargang begint den 1sten juni… Hare voortduring is onbepaald.”</i> En ondertussen kon de fanfare in het jaar 2000 haar 125 jaar al vieren!</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','270c0ac6-d907-42f8-9949-e02165c597de'),(475,475,1,'Eerste internationale onderscheiding','eerste-internationale-onderscheiding',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Op <strong>13 augustus 1882</strong> behaalt de fanfare onder leiding van haar eerste dirigent, Willebrordt Van Perck, een eerste internationale onderscheiding. In de 3de afdeling krijgen ze de 3de prijs van uitvoering. 7 jaar later speelt de fanfare al in de 1ste afdeling en nemen ze met 54 muzikanten deel aan het “Grand Concours International de Paris”, nog steeds onder leiding van dirigent Van Perck. Ze behaalt een opmerkelijke uitslag: “1ste prijs van uitvoering” en “1ste prijs van lezing op zicht”.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','190cdc16-7a16-4bc4-a638-1e2c4179aa84'),(476,476,1,'Het paviljoen','het-paviljoen',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Sedert 1889 repeteerde men niet meer in de fabriek, maar beschikte men over een eigen lokaal: het oud paviljoen, waar sinds dan ook de eetfestijnen en concerten van de fanfare doorgingen. Tot 2017 was het Paviljoen onze thuishaven. Nadien verhuisden we naar het oud-gemeentehuis in Lot en ook enkele jaren naar de Kloosterstraat, toen het oud-gemeentehuis moest plaatsmaken voor de nieuwe gemeenteschool. Sinds mei 2024 hebben we opnieuw een eigen lokaal in GBS Blokbos Lot.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','fd56b47a-6b2d-46aa-b910-286e22f6797f'),(477,477,1,'Société Royale','société-royale',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p> </p><p>In die tijd werd er vaak opgetreden in de omliggende gemeenten, werden er uitstappen georganiseerd per trein naar o.a. Dinant en vonden er ook al banketten plaats, zoals ons Sint-Ceciliafeest nu. De kostprijs toen bedroeg 2 fr. 75 per man. Ook werd er reeds samengewerkt met andere toneelverenigingen, zoals in 1898 met de toneelkring “De Toekomst”, die hiervoor een toelage ontvingen van 60 fr.</p><p> </p><p>Op 17 december 1920 wordt de fanfare officieel een “Société Royale”.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','0ced58f9-2782-4730-8a36-e70159f90a45'),(478,478,1,'Geschiedenis','geschiedenis','geschiedenis','{\"90b1aed9-67d9-4d83-baf3-2b78b929ee89\": \"<p>De geschiedenis van onze fanfare gaat ver terug, want ze is ouder dan onze gemeente Lot zelf. Als we grasduinen in de geschiedenis van Lot, de fabriek, het kanaal, de spoorweg, stuit men dan ook telkens weer op de Lotse fanfare. Zo uitgebreid gaan we het hier niet hebben over onze geschiedenis en deze van Lot. Hiervoor verwijzen we graag naar het tijdschrift van het heemkundig genootschap ‘Van Witthem’ uit Beersel, die in het jaar 2000 een editie besteedden aan de fanfare van Lot. Graag geven we hier wel een beknopt overzicht met enkele leuke en belangrijke feiten…</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','7a61d271-bb67-47f0-a716-058f147fc17f'),(479,479,1,'Het ontstaan in 1875','het-ontstaan-in-1875',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>De meeste fanfares en harmonieën ontstonden in de periode 1875-1914, want een dorp zonder muziekvereniging kon in die tijde niet meer. Zo ontstonden de Koninklijke Fanfare “Sint Lambertus” van Beersel en de Koninklijke Fanfare “<strong>Eendracht Maakt Macht</strong>” van Lot in <strong>1875</strong>, “De Onbemiddelden” uit Wauweringen in 1876, “De Eendracht” van Dworp in 1877, de Koninklijke Fanfare “De Vrijheidsvrienden” van Huizingen in 1875 en “Sint-Jozef” uit Kesterbeek tenslotte in 1899. In deze periode is er in Huizingen ook de fanfare “Sint-Leonardus”. Het kan zijn dat er over de fanfare van Dworp wel een misverstand bestaat.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','be76e423-01fd-4b56-acd1-ecaf32d35140'),(480,480,1,'Fanfaren van Loth','fanfaren-van-loth',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Onze fanfare werd opgericht op 1 juli 1875. In het kapittel van één van de statuten lezen we: <i>“Artikel I – De maatschappij, gesticht buiten alle partijgeest, onden den naam van: Fanfaren van Loth met de leus Eendracht Maakt Macht, heeft voor doel het onderricht, het oefenen en de verbetering van de muziekkunst. De zetel der maatschappij is gevestigd te Loth, gemeente Sint-Pieters-Leeuw. De muziekale jaargang begint den 1sten juni… Hare voortduring is onbepaald.”</i> En ondertussen kon de fanfare in het jaar 2000 haar 125 jaar al vieren!</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','f1e741af-3411-4b0d-93b6-31a82c94094b'),(481,481,1,'Eerste internationale onderscheiding','eerste-internationale-onderscheiding',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Op <strong>13 augustus 1882</strong> behaalt de fanfare onder leiding van haar eerste dirigent, Willebrordt Van Perck, een eerste internationale onderscheiding. In de 3de afdeling krijgen ze de 3de prijs van uitvoering. 7 jaar later speelt de fanfare al in de 1ste afdeling en nemen ze met 54 muzikanten deel aan het “Grand Concours International de Paris”, nog steeds onder leiding van dirigent Van Perck. Ze behaalt een opmerkelijke uitslag: “1ste prijs van uitvoering” en “1ste prijs van lezing op zicht”.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','8fe3edd8-ba37-46ba-9608-624d0d696f77'),(482,482,1,'Het paviljoen','het-paviljoen',NULL,'{\"2f473574-020f-4604-a894-c1b180fc74e0\": \"<p>Sedert 1889 repeteerde men niet meer in de fabriek, maar beschikte men over een eigen lokaal: het oud paviljoen, waar sinds dan ook de eetfestijnen en concerten van de fanfare doorgingen. Tot 2017 was het Paviljoen onze thuishaven. Nadien verhuisden we naar het oud-gemeentehuis in Lot en ook enkele jaren naar de Kloosterstraat, toen het oud-gemeentehuis moest plaatsmaken voor de nieuwe gemeenteschool. Sinds mei 2024 hebben we opnieuw een eigen lokaal in GBS Blokbos Lot.</p>\"}',1,'2024-06-08 12:34:21','2024-06-08 12:34:21','6cdd2350-8069-416b-bae8-0d9df67b8ae5')