b28d-8a20-4437-8d47-e5880deff0dc'),(598,598,1,'Dhr. Willebrordt Van Perck','dhr-willebrordt-van-perck',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. Willebrordt Van Perck\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1875-1909\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','528c7256-23b5-4c80-b397-390b57dabed2'),(599,599,1,'Dhr. Frans Backx','dhr-frans-backx',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. Frans Backx\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1910-1919\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','b05aa2fe-163f-4fd0-863e-ce289b419d4f'),(600,600,1,'Dhr. Casse','dhr-casse',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. Casse\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1919-1931\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','78a5ba47-4dba-4d48-b4af-c1d12dab446b'),(601,601,1,'???','__temp_mhqirpimqqbbryymltdjfujugdrcrcackksu',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"???\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1931-1935\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','4e1d01c4-7bf2-437d-a4cc-f98b4f9d0332'),(602,602,1,'Dhr. L. Horenbeek','dhr-l-horenbeek',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. L. Horenbeek\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1935-1948\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','7c2b9157-2430-452f-a1ba-5554b8132fbc'),(603,603,1,'Dhr. Albert Weemaels','dhr-albert-weemaels',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. Albert Weemaels\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1948-1974\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','d3188ba8-cf76-4633-bfdd-c6a701307ee6'),(604,604,1,'Dhr. Pierre Weemaels','dhr-pierre-weemaels',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7cc738\": \"Dhr. Pierre Weemaels\", \"63c4b29f-fa3d-4c34-9a1e-175b97b08cfb\": \"1974-1984\"}',1,'2024-06-09 18:53:30','2024-06-09 18:53:30','67f572ed-7bc7-4b19-9ec8-d408cb4c1452'),(605,605,1,'Dhr. Jan Loris','dhr-jan-loris',NULL,'{\"54d26c36-7c5e-4376-88a7-971a5c7